document.addEventListener('DOMContentLoaded', () => {
  const gd = document.getElementById('plotly-graph');
  const box = gd.parentElement;
  box.style.position = 'relative';

  // Barre de recherche
  const searchInput = document.createElement('input');
  searchInput.placeholder = 'Chercher ID...';
  searchInput.style.cssText = 'position:absolute;top:10px;left:10px;padding:5px;z-index:10;';
  box.appendChild(searchInput);

  const searchBtn = document.createElement('button');
  searchBtn.textContent = 'Rechercher';
  searchBtn.style.cssText = 'position:absolute;top:10px;left:160px;padding:5px;z-index:10;';
  box.appendChild(searchBtn);

  let originalSize = gd.data[0].marker.size;
  let originalColor = gd.data[0].marker.color;

  function highlightMatches(query) {
    const sizes = [];
    const colors = [];
    gd.data[0].customdata.forEach(id => {
      if (id.toLowerCase().includes(query.toLowerCase())) {
        sizes.push(14);
        colors.push('yellow');
      } else {
        sizes.push(originalSize);
        colors.push(originalColor);
      }
    });
    Plotly.restyle(gd, {'marker.size': [sizes], 'marker.color': [colors]}, [0]);
  }

  searchBtn.onclick = () => {
    const query = searchInput.value.trim();
    if (query) highlightMatches(query);
  };

  searchInput.onkeydown = e => {
    if (e.key === 'Enter') searchBtn.click();
  };
});
